    constructor(props) {
        super(props);
        this.state = {
            books : [],
        }
    }

    render() {
        return (
            <div>
                <h1>Aasdasdasdasd</h1>
                {/*<Books books={this.state.books}/>*/}
            </div>
        );
    }

    loadBooks = () =>{
        LabService.fetchBooks()
            .then((data) =>{
                this.setState({
                    books: data.data
                });
            })
    }

    componentDidMount() {
        this.loadBooks();
    }

}

export default App;
